# Improve readability

Charts should read like text. At the most basic level, it should be obvious what the chart is about and how to interpret it.

&lt;div align="center"&gt;
&lt;img src="https://flowingdata.com/wp-content/uploads/2020/07/flat-750x525.png" width=600&gt;
&lt;/div&gt;

---
## Tufte's Principles of Graphical Integrity

1. Show data variation, not design variation
1. Do not use graphics to quote data out of context
1. Use clear, detailed, thorough labelling. 
1. Representation of numbers should be directly proportional to numerical quantities
1. Don't use more dimensions than the data require

---

# Nathan Yau's Seven Basic Rules for Making Charts and Graphs

1. Check the data
1. Explain encodings
1. Label axes
1. Include units
1. Keep your geometry in check
1. Include your sources
1. Consider your audience

---

.pull-left[
### 1) Check the data

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/1-check-the-data.jpg"&gt;

* This should be obvious
* If your data is weak, your chart is weak
* Start with simple graphs to see if there are any outliers
]

--

.pull-right[
### 2) Explain encodings

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/2-explain-encodings.jpg"&gt;

* Don't assume the reader knows what everything means
* Provide a legend
* Label shapes
* Explain color scales
]

---

.pull-left[
### 3) Label axes

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/3-labels-axes.jpg"&gt;

* Axes without labels or explanation are just decoration
* Describe the scale (incremental, exponential, logarithmic?)
* Have axes values start at zero
]

--

.pull-right[
### 4) Include units

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/4-include-units.jpg"&gt;

* Numbers without units are meaningless
* Remove the guesswork
]

---

.pull-left[
### 5) Keep your geometry in check

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/5-keep-geometry-in-check.jpg"&gt;

* This is something that is immediately noticeable
* Don't use area to compare two units unless they are an area. An increase in a unit squares the area.
* Tip: size circles and other 2D shapes by area, unless it's a bar chart
]

--

.pull-left[
### 6) Include your sources

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/6-sources.jpg"&gt;

* This is another obvious one
* Always include the source of your data
* Makes your graphic more reputable
* Allows for others to dig deeper
]


---

.pull-left[
### 7) Consider your audience

&lt;img src="https://flowingdata.com/wp-content/uploads/2010/07/7-audience.jpg"&gt;

* What purpose do your charts have and who are they for?
* Avoid quirky fonts
* Make good design choices
]

---

# Visualization critiques: what is wrong with this picture?

* What is the first thing you notice about this visualization?
* What point is the visualization trying to make?
* Who is the intended audience?
* What is the visualization doing well?
* What problems do you see with the visualization design?

# Time Series

---

## What are time series?

### A **time series** is a series of data that is indexed by time. 

Most commonly, time series are 

+ Data collected on a particular subject (observational unit)
+ at regular time intervals

--

### Examples

+ The NYSE ticker for particular stocks
+ Temperature of an industrial turbine
+ Daily cases and deaths from Sars-COV-2

---
background-image: url(img/FT_covid1.png)
background-size: contain

---

## Repeated measures data

Repeated measures data are a generalization of time series data

+ Data collected on a subject
+ over time, but not necessarily at regular intervals

Also called **longitudinal data**

--

### Examples

+ Blood draws in a clinical trial of a chemotherapy
+ Marital status of a person over time
+ State of residence of a person over time

---
class: middle,center,inverse

# Visualizing repeated measures data

---

## Time is paramount

### The defining characteristic of repeated measures data is its relationship with time

Typically the time scale is placed on the x-axis, and the repeated observations are plotted on the y-axis

The successive data values **are joined** to give the visual impression that 
they are connected by the common subject

The basic idea is to have a sense of continuity over time

## Line plots

If the patterns are too _noisy_, you can smooth the lines using a _loess_ or 
_polynomial_ smoother


```r
ggplot(d, aes(date, price, color=company))+
  geom_point(size=2, alpha=0.5)+
  geom_smooth(method='loess', size=2, se=F, show.legend=F,
              span = 0.1)+
  scale_x_date(name = '', labels = scales::label_date(format='%b, %Y'))+
  scale_y_continuous(labels = scales::label_dollar())+
  guides(color = guide_legend(title = NULL,nrow=1))+
  theme(legend.position=c(0.2, 0.9),
        legend.background=element_rect(color='lightblue'))
```

&lt;img src="slide_10_files/figure-html/unnamed-chunk-5-1.png" width="504" /&gt;

## Area plots

The aim is to draw the eye to highlight changes in data over time

Using a filled-in area accentuates the height of the line

This technique is especially useful when we are looking at differences from a reference level, say 0

---



.pull-left[

```r
ggplot(jpn_data, 
       aes(x = date, y = NY.GDP.MKTP.KD.ZG))+
  geom_line()+
  geom_hline(yintercept = 0, linetype=2)+
  mylabs
```
]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-9-1.png" width="504" /&gt;
]

---


.pull-left[

```r

       aes(x = date, y = NY.GDP.MKTP.KD.ZG))+
  geom_area()+
  mylabs
```

  geom_area(data=filter(jpn_data, NY.GDP.MKTP.KD.ZG &lt;=0),

# Comparing multiple time series

---

## Spaghetti plots

_Spaghetti_ plots are multiple line plots drawn on the same axes, which 
gives an appearance of spaghetti

.pull-left[
The main purpose of the spaghetti plot is to give a sense of variability
of the time series patterns across multiple observation units

However, it is almost impossible to identify any particular series without highlighting

Spaghetti plots can come to the fore when using dynamic plots, where we 
can add highlights and meta-data to each series

Typically the individual series are plotted using a lighter color or
transparency so that the highlighted series can pop

]
.pull-right[
![](img/FT_covid1.png)
]

---

## Spaghetti plots



```r
covid &lt;- COVID19::covid19(verbose=FALSE) %&gt;% ungroup() %&gt;% select(id, date, deaths) %&gt;% 
  mutate(highlight = (id %in% c('USA','GBR','FRA','JPN','KOR','SWE')))
*ggplot(covid, aes(x=date, y=deaths, group = id, color = highlight))+
  geom_line(show.legend=FALSE) + 
  scale_y_log10('Deaths', labels=scales::label_number_si())+
  scale_x_date('', labels = scales::label_date('%b, %Y'))+
  scale_color_manual(values = c('lightgrey', 'orange'))+
  labs(title='Cumulative deaths from COVID-19 globally',
       caption='Source: COVID-19 Data Hub')
```

## Stacked area plots

.pull-left[

```r
covid &lt;- read_csv('data/covid_plot_data.csv') %&gt;% 
  select(-highlight) %&gt;% 
  group_by(id) %&gt;% 
  mutate(daily = deaths-lag(deaths)) %&gt;% # Daily deaths
  mutate(daily7 = zoo::rollmean(daily, k = 7, na.pad=T)) # Rolling mean
ggplot(covid, aes(x=date, y = daily7, 
                  fill = id))+
  geom_area(position='stack', show.legend=F)+
  labs(x='', y = 'Count', 
       title='Daily COVID-19 deaths by country')  
```
]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-17-1.png" width="504" /&gt;
]

The issue with stacked area plots (as well as stacked bar plots) is that you have a good handle on what is going on in the bottom-most layer, and overall by looking at the top, but you can't really tell what's going on in the middle

## Stream graphs

A streamgraph, or stream graph, is a type of stacked area graph which is displaced around a central axis, resulting in a flowing, organic shape. Unlike a traditional stacked area graph in which the layers are stacked on top of an axis, in a streamgraph the layers are positioned to minimize their "wiggle" (Wikipedia)

The basic idea is to show relative prevalence of different categories at each point in time, with some smoothing implemented to make the graph "flow" around a centra axis rather than the x-axis.

A stream graph can be more interpretable than a stacked area chart

---

## Stream graphs


```r
library(zoo)
library(streamgraph)
covid &lt;- read_csv('data/covid_plot_data.csv') %&gt;% 
  select(-highlight) %&gt;% 
  group_by(id) %&gt;% 
  mutate(daily = deaths-lag(deaths)) %&gt;% # Daily deaths
  mutate(daily7 = rollmean(daily, k = 7, na.pad=T)) # Rolling mean
streamgraph(covid, key='id', date='date',value='daily7', 
            interactive=FALSE, height=300, width=800)
```

## Moving (rolling) averages

Moving averages are often employed to remove noise from signal. You have to
specify a window (number of consecutive observations to average over)

---
.pull-left[

```r
library(zoo)
covid_daily %&gt;% 
  group_by(id) %&gt;% 
  mutate(ma = rollmean(daily, k = 7, 
                       na.pad=TRUE)) %&gt;% 
  ungroup() %&gt;% 
  filter(id %in% c('USA','GBR','FRA',
                   'JPN','KOR')) %&gt;% 
  ggplot(aes(x=date, y = daily))+
  geom_line(aes(color=id))+
  labs(x='', y = 'Count', color='',
       title = 'Daily deaths from COVID-19')
```
]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-24-1.png" width="504" /&gt;
]

## A few words about natural language processing (NLP)

There are several steps that are commonly performed in textual analyses, 
including tokenizing, stemming, lemmatizing and other processing steps. 

Common uses for textual analytics include sentiment analysis, identifying common patterns in texts (useful for literature research and intelligence), 
summarizing corpuses of texts by identifying key words and phrases.

In this class we won't talk about the analytics aspects per se, but we will 
describe some of the possible visualizations that can arise from textual analyses.

## Word clouds

Word clouds are one way to show the **frequency distribution** of words in a document

.pull-left[

```r
library(wordcloud)

tidy_books %&gt;%
  anti_join(stop_words) %&gt;%
  count(word) %&gt;%
  with(wordcloud(word, n, max.words = 100))
```

There is a bit of randomness to how the word cloud is arranged, though
the relative sizes of the words remain the same

## Word clouds

You can also use word clouds to compare the frequencies of words within different sentiments

.pull-left[

```r
library(reshape2)

tidy_books %&gt;%
  inner_join(get_sentiments("bing")) %&gt;%
  count(word, sentiment, sort = TRUE) %&gt;%
  pivot_wider(id_cols=word, 
              names_from = sentiment, 
              values_from = n, values_fill=0) %&gt;% 
  column_to_rownames('word') %&gt;% 
  as.matrix() %&gt;% 
  comparison.cloud(colors = c("gray20", "gray80"),
                   max.words = 100)
```

&gt; `comparison.cloud` is based on base R graphics. It requires a _matrix_ as input rather than a _data frame_
]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-31-1.png" width="504" /&gt;

## Frequency distribution of words

---

There are two metrics commonly used in NLP:

+ The _term frequency_ (tf), i.e. how often a word appears in a document
+ The _inverse document frequency_ (idf), i.e. how rarely a term appears in a collection of documents, and is defined as 



`$$idf(\text{term}) = \ln\left(\frac{n_{\text{documents}}}{n_{\text{documents containing term}}}\right)$$`

These are often combined in a _td-idf_, the product of _td_ and _idf_, which is intended to measure how important a word is to a document in a collection (or corpus) of documents
---

The term frequencies tend to be skew and long tailed



.pull-left[

```r
library(ggplot2)

ggplot(book_words, aes(n/total, fill = book)) +
  geom_histogram(show.legend = FALSE) +
  xlim(NA, 0.0009) +
  facet_wrap(~book, ncol = 2, scales = "free_y")
```

This typical distribution is known as **Zipf's Law**, and we can check how well a book's term frequencies align with it.
]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-33-1.png" width="504" /&gt;
]

---




.pull-left[

```r
freq_by_rank %&gt;% 
  ggplot(aes(rank, `term frequency`, 
             color = book)) + 
  geom_abline(intercept=-0.62, slope=-1.1, 
              color='gray50', linetype=2)+
  geom_line(size = 1.1, alpha = 0.8, 
            show.legend = FALSE) + 
  scale_x_log10() +
  scale_y_log10()
```

All six books have very similar characteristics, but are not quite following a straight line, which would indicate alignment with Zipf's Law. 

Note we are plotting on a log-log scale]

## Network of bigrams

---

Bigrams are pairs of words (tokens) that occur together. More generally, you can consider _n_-grams. 



.pull-left[

```r
library(igraph)
library(ggraph)
set.seed(2017)

bigram_graph &lt;- bigram_counts %&gt;%
  filter(n &gt; 20) %&gt;%
  graph_from_data_frame()

ggraph(bigram_graph, layout = "fr") +
  geom_edge_link() +
  geom_node_point() +
  geom_node_text(aes(label = name), 
                 vjust = 1, hjust = 1)
```

Here we are showing common (occurring at least 20 times) bigrams from Austen's novels, where neither word is a stop word ]
.pull-right[
&lt;img src="slide_10_files/figure-html/unnamed-chunk-37-1.png" width="504" /&gt;

]

set.seed(2016)

                 show.legend = FALSE,

  geom_node_point(color = "lightblue", 
                  size = 5) +
